script: |
  super -f text -I q6703.spq | sort > q6703.out

inputs:
  - name: q6703.spq
    data: |
      SELECT + 58 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - - col0 * - - col1 * 90 NOT IN ( + col1 - - - col1, col0 ) );
  - name: tab0

outputs:
  - name: q6703.out
    data: |
      58
      58
      58
